def fac(n) :
    for i in range(1,n) :
        n *= i         

    while n%10==0 :
        n //= 10

    return str(n)[-5:]

n = int(input())
print(fac(n))

def f(x):
    if x == 1:
        return 1
    elif x > 1:
        return x * f(x-1)

while True:
    x = int(input())
    if x >= 9 and x <= 1000000:
        a = f(x)
        while True:
            a = int( a / 10 )
            if a % 10 == 0:
                continue
            else:
                break
        a = int(a % 100000)
        print('%05d'%(a))
    else:
        break
